import React, { Component } from "react";

const card = {
  height: "80",
  width: "80%",
  boxShadow: "5px 5px #bbb",
  border: "1px solid",
  padding: "10px",
  margin: "20px 0px",
  marginLeft: "auto",
  color: "black",
  cursor: "pointer"
};
class Titles extends Component {
  render() {
    return (
      <div>
        <div style={card}>{this.props.data.title}</div>
      </div>
    );
  }
}

export default Titles;
